script: |
  super -f text -I q7532.spq | sort > q7532.out

inputs:
  - name: q7532.spq
    data: |
      SELECT DISTINCT - - cor1.col0 * + cor1.col1 AS col0 FROM tab0 (FORMAT parquet), tab0 (FORMAT parquet) AS cor0, tab1 (FORMAT parquet), tab0 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q7532.out
    data: |
      2064
      3395
      8099
